import React from 'react';
import './App.css';
import Header from './components/Header';
function App() {
  return (
        <div className="App">
        {
          <>
          <Main/>
          <BrowserRouter>
          <Routes>
            <Route path='/Header' element= {<Header/>}/>
            <Route path='/Footer' element= {<Footer/>}/>
            <Route path='*' element={<Erorr/>}/>
            <Route path='/' element= {<Home/>}/>
          </Routes>
          </BrowserRouter>

          </>
      }
     </div>   
);
}
export default App;
